import Navbar from "./components/Navbar/index";
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';
import "./App.css"

function App() {
  return (
    <Router>
      <Navbar />
      <Switch>
        <Route path='/' exact Component={Home} />
      </Switch>
    </Router>
  );
}

export default App;
